import React, {Component} from 'react'
import {PageData} from '../../../utils/context/pageContext'
// import {connect} from 'react-redux'
// import Button from '../../../components/Buttons/Buttons'
// import Skill from './Skill/Skill'
// import './Skills.css'

class Skills extends Component {
  static contextType = PageData

  render () {

    let data = this.context.skills
    console.log(data)
    
    // let createDesign = <Skill skills={data.skills.creativeDesign} />
    // let frontend = <Skill skills={data.skills.frontend} />
    // let backend = <Skill skills={data.skills.backend} />

    return (
      <section className="section-container skills">
        <div className="section-background"
          style={{background: 
        `url('${data.background}') repeat center top`}}>

          <div className="section-wrapper">
            {createDesign}
            {frontend}
            {backend}
            <article className='section-article-wrapper'>
              <div className="sub-reveal-container desc show">
                <span className="sub-reveal"
                  style={{color: '#ABA98F'}}>
                    <Button 
                      text='View projects' 
                      withSvg={false}
                      link='projects'
                      btnType='box-button'
                      colors='#347A78'
                      type='withBox'/>
                </span>
              </div>
            </article>

          </div>

        </div> 
      </section>
    )
  }
}

